import React from 'react';
import '../styles/Header.css'; // Asigură-te că calea către fișierul CSS este corectă

function Header() {
  return (
    <header className="header">
      <h1>JavaVerse</h1>
      <nav>
        <button>Login</button>
        <button>Register</button>
      </nav>
    </header>
  );
}

export default Header;
